Description: Kortney Kane, Nina Mercedez - The History Of Lesbians

Nina is bringing her class to the Museum. The exhibit is on the history of lesbians. Nina hopes to inform the girls the plight of lesbians and as well enlighten their sexuality, but Kortney keeps interrupting Nina with the most outlandish comments and making a mockery of everything Nina stands for. ...
